webpackJsonp([0x27530fad07e62600],{"./node_modules/json-loader/index.js!./.cache/json/java-defining-attributes.json":function(n,s){n.exports={data:{markdownRemark:{html:'<h2>Defining Attributes</h2>\n<p>A class has attributes and methods. The attributes are basically variables within a class.</p>\n<p><strong><em>Example:</em></strong></p>\n<div class="gatsby-highlight">\n      <pre class="language-java"><code><span class="token keyword">public</span> <span class="token keyword">class</span> <span class="token class-name">Vehicle</span> <span class="token punctuation">{</span>\n  <span class="token keyword">int</span> maxSpeed<span class="token punctuation">;</span>\n  <span class="token keyword">int</span> wheels<span class="token punctuation">;</span>\n  String color<span class="token punctuation">;</span>\n  \n  <span class="token keyword">void</span> <span class="token function">horn</span><span class="token punctuation">(</span><span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    System<span class="token punctuation">.</span>out<span class="token punctuation">.</span><span class="token function">println</span><span class="token punctuation">(</span><span class="token string">"Beep beep!"</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>\n<p><code>maxSpeed</code>, <code>wheels</code>, and <code>color</code> are all attributes of our Vehicle class and the <code>horn()</code> is the only method.</p>\n<h3>Creating Objects</h3>\n<p>We can create multiple objects of our Vehicle class, and use the dot syntax to access their attributes and methods.</p>\n<div class="gatsby-highlight">\n      <pre class="language-java"><code><span class="token keyword">class</span> <span class="token class-name">MyClass</span> <span class="token punctuation">{</span>\n  <span class="token keyword">public</span> <span class="token keyword">static</span> <span class="token keyword">void</span> <span class="token function">main</span><span class="token punctuation">(</span>String<span class="token punctuation">[</span><span class="token punctuation">]</span> args<span class="token punctuation">)</span> <span class="token punctuation">{</span>\n    Vehicle v1 <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Vehicle</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    Vehicle v2 <span class="token operator">=</span> <span class="token keyword">new</span> <span class="token class-name">Vehicle</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n    v1<span class="token punctuation">.</span>color <span class="token operator">=</span> <span class="token string">"red"</span><span class="token punctuation">;</span>\n    v2<span class="token punctuation">.</span><span class="token function">horn</span><span class="token punctuation">(</span><span class="token punctuation">)</span><span class="token punctuation">;</span>\n  <span class="token punctuation">}</span>\n<span class="token punctuation">}</span>\n</code></pre>\n      </div>',fields:{slug:"/java/defining-attributes/"},frontmatter:{title:"Defining Attributes"}}},pathContext:{slug:"/java/defining-attributes/"}}}});
